import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { LoginComponent } from './pages/auth/login/login.component';
import { AuthorListComponent } from './pages/author/author-list/author-list.component';
import { ObraListComponent } from './pages/author/obra-list/obra-list.component';
import { InfoObraComponent } from './pages/author/info-obra/info-obra.component';
import { AuthorCrearComponent } from './pages/author/author-crear/author-crear.component';
import { ObraCrearComponent } from './pages/obra/obra-crear/obra-crear.component';
import { HomeComponent } from './pages/home/home.component';

@NgModule({
  declarations: [
    AppComponent,
    LoginComponent,
    AuthorListComponent,
    ObraListComponent,
    InfoObraComponent,
    AuthorCrearComponent,
    ObraCrearComponent,
    HomeComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
